import React from "react";
import { Card,Container,Image } from "react-bootstrap";
import UserProfil from "../wiki/UserProfil";
import defaut from "../img/defaut_awatar.jpg"
const UserPage = () => {
    const userProfil = new UserProfil();
    console.log(userProfil)
    return (
        <Card
            style={{borderRadius: 20, margin: '0px 10px 0px 10px', borderWidth: '5px'}}
        >
            <div className="flex">
                <Container>
                <Image
                    style={{margin: 20}}
                    src = {defaut}
                    width={300}
                    height={300}
                    roundedCircle
                ></Image>
                <div>
                    <div>{userProfil.user.fn}</div>
                    <div>{userProfil.user.sn}</div>
                </div>
                </Container>
            </div>

            <div style={{fontSize: 30, marginLeft: 30}}>
                О себе:
            </div>

        </Card>
    );
};

export default UserPage;
